import React from 'react';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Button,
  IconButton,
  Divider,
} from '@mui/material';
import {
  Add as AddIcon,
  Remove as RemoveIcon,
  Delete as DeleteIcon,
} from '@mui/icons-material';

const Cart = () => {
  // This would typically come from a cart context or state management
  const cartItems = [
    {
      id: 1,
      name: 'Professional Telescope',
      price: 599.99,
      quantity: 1,
      image: 'https://images.unsplash.com/photo-1462331940025-496dfbfc7564?auto=format&fit=crop&w=2048&q=80',
    },
  ];

  const subtotal = cartItems.reduce((acc, item) => acc + item.price * item.quantity, 0);
  const shipping = 29.99;
  const total = subtotal + shipping;

  return (
    <Container maxWidth="lg" sx={{ mt: { xs: 12, sm: 14 }, mb: 6 }}>
      <Typography 
        variant="h2" 
        sx={{ 
          mb: 6,
          background: 'linear-gradient(45deg, #7c4dff, #1a237e)',
          WebkitBackgroundClip: 'text',
          WebkitTextFillColor: 'transparent',
          textAlign: 'center',
        }}
      >
        Your Cart
      </Typography>

      {cartItems.length === 0 ? (
        <Box 
          sx={{ 
            textAlign: 'center',
            py: 8,
          }}
        >
          <Typography variant="h5" sx={{ mb: 3 }}>
            Your cart is empty
          </Typography>
          <Button 
            variant="contained" 
            href="/products"
            sx={{
              background: 'rgba(124, 77, 255, 0.8)',
              '&:hover': { 
                background: 'rgba(124, 77, 255, 1)',
                transform: 'translateY(-2px)',
              },
              transition: 'all 0.3s ease-in-out',
            }}
          >
            Continue Shopping
          </Button>
        </Box>
      ) : (
        <Grid container spacing={4}>
          <Grid item xs={12} md={8}>
            {cartItems.map((item) => (
              <Card 
                key={item.id}
                sx={{
                  mb: 2,
                  background: 'rgba(255,255,255,0.05)',
                  backdropFilter: 'blur(10px)',
                  border: '1px solid rgba(255,255,255,0.1)',
                  transition: 'all 0.3s ease-in-out',
                  '&:hover': {
                    border: '1px solid rgba(124, 77, 255, 0.3)',
                  },
                }}
              >
                <Box sx={{ display: 'flex', p: 2 }}>
                  <CardMedia
                    component="img"
                    sx={{ width: 150, objectFit: 'cover' }}
                    image={item.image}
                    alt={item.name}
                  />
                  <CardContent sx={{ flex: 1, display: 'flex', flexDirection: 'column', justifyContent: 'space-between' }}>
                    <Box>
                      <Typography variant="h6" sx={{ color: '#fff' }}>
                        {item.name}
                      </Typography>
                      <Typography variant="h6" sx={{ color: '#7c4dff', mt: 1 }}>
                        ${item.price.toFixed(2)}
                      </Typography>
                    </Box>
                    <Box sx={{ display: 'flex', alignItems: 'center', mt: 2 }}>
                      <IconButton 
                        size="small"
                        sx={{ 
                          color: '#fff',
                          '&:hover': { background: 'rgba(255,255,255,0.1)' }
                        }}
                      >
                        <RemoveIcon />
                      </IconButton>
                      <Typography sx={{ mx: 2, color: '#fff' }}>
                        {item.quantity}
                      </Typography>
                      <IconButton 
                        size="small"
                        sx={{ 
                          color: '#fff',
                          '&:hover': { background: 'rgba(255,255,255,0.1)' }
                        }}
                      >
                        <AddIcon />
                      </IconButton>
                      <IconButton 
                        size="small"
                        sx={{ 
                          ml: 2,
                          color: '#ff4444',
                          '&:hover': { background: 'rgba(255,68,68,0.1)' }
                        }}
                      >
                        <DeleteIcon />
                      </IconButton>
                    </Box>
                  </CardContent>
                </Box>
              </Card>
            ))}
          </Grid>
          <Grid item xs={12} md={4}>
            <Card
              sx={{
                background: 'rgba(255,255,255,0.05)',
                backdropFilter: 'blur(10px)',
                border: '1px solid rgba(255,255,255,0.1)',
                position: 'sticky',
                top: 100,
              }}
            >
              <CardContent>
                <Typography variant="h6" sx={{ mb: 3, color: '#fff' }}>
                  Order Summary
                </Typography>
                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                  <Typography sx={{ color: 'rgba(255,255,255,0.7)' }}>Subtotal</Typography>
                  <Typography sx={{ color: '#fff' }}>${subtotal.toFixed(2)}</Typography>
                </Box>
                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                  <Typography sx={{ color: 'rgba(255,255,255,0.7)' }}>Shipping</Typography>
                  <Typography sx={{ color: '#fff' }}>${shipping.toFixed(2)}</Typography>
                </Box>
                <Divider sx={{ my: 2, borderColor: 'rgba(255,255,255,0.1)' }} />
                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 3 }}>
                  <Typography variant="h6" sx={{ color: '#fff' }}>Total</Typography>
                  <Typography variant="h6" sx={{ color: '#7c4dff' }}>${total.toFixed(2)}</Typography>
                </Box>
                <Button
                  fullWidth
                  variant="contained"
                  sx={{
                    background: 'rgba(124, 77, 255, 0.8)',
                    '&:hover': { 
                      background: 'rgba(124, 77, 255, 1)',
                      transform: 'translateY(-2px)',
                    },
                    transition: 'all 0.3s ease-in-out',
                    py: 1.5,
                  }}
                >
                  Checkout
                </Button>
              </CardContent>
            </Card>
          </Grid>
        </Grid>
      )}
    </Container>
  );
};

export default Cart;
